import React from 'react';
import ReactPlayer from 'react-player';
import './VideoQueue.css';




const VideoQueue = ( {videoNames, changeVideo, deleteVideo, dragStart, dragOver, dragEnd} ) => {
	const state = {
		playing: 0,
		width: '168 px',
		height: '94 px',
		controls: false

	}

	const videos = videoNames.slice(1);
	const videoComp = (videos || []).map((user, i) => {
		return (
		<div className = 'playerContainer'   dragOver = {() => dragOver(i+1)} draggable>
				<div onDragStart = {() => dragStart(i+1) } dragEnd = {dragEnd}  >
					<ReactPlayer 
				      	url = {JSON.stringify(videos[i].youtube)}
				      	width = {state.width}
				      	height= {state.height}
				      	playing = {state.playing}
				      	controls = {state.controls}
				      	onClick={changeVideo}
				      	/>
				    <button onClick = {()=> {deleteVideo(videoNames[i])}}>Delete</button>
				</div>
		</div>)
	})	

	return(
		
		<div>
			{videoComp}
		</div>
	);
}

export default VideoQueue;
